import { Component } from '@angular/core';
import { ApiService } from '../api.service';
import { Shipment } from '../Models/shipment';
import { DataSource } from '@angular/cdk/collections';
import { MatTableDataSource } from '@angular/material/table';


@Component({
  selector: 'app-blog',
  templateUrl: './blog.component.html',
  styleUrls: ['./blog.component.css']
})
export class BlogComponent {
  shipmentData: Shipment[];
  constructor(private apiService: ApiService){
    this.shipmentData=[];
  }
  //displayedColumns: any[] = ['position', 'name', 'weight', 'symbol'];

  displayedColumns: string[] = ['ShptNmbr', 'Name', 'Locn', 'Qnty','CstmRpnt','Rpnt','Imgs','Note','Wght','Dmnsn'];
  dataSource:any;

  ngAfterViewInit(): void {
    this.getShipments();
  }

  getShipments(){
    this.apiService.getAllShipments().subscribe(
      (response:any)=>{
        this.shipmentData=response;
        this.dataSource=new MatTableDataSource(this.shipmentData);
      },
      (error)=>{
        console.log("Api call failed",error);
      }
    );
  }
}

export interface PeriodicElement {
  name: string;
  position: number;
  weight: number;
  symbol: string;
}

const ELEMENT_DATA: PeriodicElement[] = [
  {position: 1, name: 'Hydrogen', weight: 1.0079, symbol: 'H'},
  {position: 2, name: 'Helium', weight: 4.0026, symbol: 'He'},
  {position: 3, name: 'Lithium', weight: 6.941, symbol: 'Li'},
  {position: 4, name: 'Beryllium', weight: 9.0122, symbol: 'Be'},
  {position: 5, name: 'Boron', weight: 10.811, symbol: 'B'},
  {position: 6, name: 'Carbon', weight: 12.0107, symbol: 'C'},
  {position: 7, name: 'Nitrogen', weight: 14.0067, symbol: 'N'},
  {position: 8, name: 'Oxygen', weight: 15.9994, symbol: 'O'},
  {position: 9, name: 'Fluorine', weight: 18.9984, symbol: 'F'},
  {position: 10, name: 'Neon', weight: 20.1797, symbol: 'Ne'},
];
